import "../../App.css";
import cardBackground from './cardBackground'

function Card(props) {

    const url = "url(" +props.backgroundURL+ ")";

    const cardStyle = {
        backgroundImage: url,
        backgroundPosition: "center",
        height: "340px",
        width: "340px",
        //margin: "50px 0",
        borderRadius: "10px",
    }

    return (
            <div className="card" style={cardStyle}>
                <div className="cardOverlay">
                    <h2 className="cardTitle">{props.title}</h2>
                </div>
            </div>
    )
}

export default Card;
